INSERT INTO `product` VALUES (100,'CORENGTH Élastique 35 kg',30,'EUR',120,'Cet élastique de musculation 35kg est parfait pour apporter la résistance nécessaire à votre progression à chaque entraînement.','AVAILABLE'),(101,'CORENGTH Élastique 15 kg',25,'EUR',120,'Variez vos entrainements avec l\'élastique de musculation de 15 kg. Sa résistance ajoute une difficulté à certains exercices ou apporte un soutien pour d\'autres.','AVAILABLE'),(102,'5-tube Bandes De Résistance',50,'EUR',120,'Entraîneur De Muscle De Poitrine, Écarteur De Poitrine, Entraîneur De Force De Bras Réglable, Bande De Résistance D\'exercice Pour L\'entraînement Musculaire, La Musculation Et L\'entraînement De Force','AVAILABLE'),(103,'1 Pc Bandes De Résistance Élastiques',65,'EUR',100,'Bande De Tube D\'exercice De Forme Physique De Corde De Traction De Yoga Pour Des Entraînements À La Maison','AVAILABLE'),(104,'Gants de musculation - noir',40,'EUR',250,'Ces gants de musculation sont le partenaire idéal pour maintenir l\'hygiène de vos mains lors de vos séances de musculation à la salle de sport.','AVAILABLE'),(107,'Ceinture De Traction',15,'EUR',300,'Bande De Poignet Antidérapante Réglable Avec Conception De Pointe En Silicone Et Coussin SCR Respirant, Bande De Protection Du Poignet Pour L\'haltérophilie, Le Crossfit, L\'haltérophilie, La Musculation','AVAILABLE'),(109,'DMoose Crochet Poignet',39,'EUR',200,'dragonnes de Maintien de poignée pour Hommes et Femmes,néoprène rembourré de 8 mm d\'épaisseur,soulevé de Terre, dynamophilie, Barre de Traction','AVAILABLE'),(110,'Gants musculation V2',45,'EUR',100,'Les gants de musculation sont des accessoires conçus pour protéger les mains lors d’exercices de musculation. Ils sont généralement fabriqués à partir de matériaux résistants tels que le cuir ou le néoprène, et sont équipés de rembourrages pour protéger les paumes et les doigts.','AVAILABLE'),(111,'Machine Multi-Taches',1999,'EUR',23,'Une machine performante, avec une excellente fluidité.\r\nVous pouvez entraîner l\'ensemble de vos muscles grâce au banc complet SMITH MACHINE COBRA II de Moovyoo et obtenir la musculature dont vous rêvez.\r\nLe meilleur rapport qualité/prix du marché en exclusivité chez FitnessBoutique !','AVAILABLE');
/*!40000 ALTER TABLE `product` ENABLE KEYS */;
